import React, { Component } from "react";
import Slider from "react-slick";

export default class Sliders extends Component {
  render() {
    const settings = {
      dots: false,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 3
    };
    return (
      <div>
        <Slider {...settings}>
          {Array.from({length:10}).map((item,index)=>(
            <div>
              <img src={process.env.PUBLIC_URL + `/navbar/img${index}.jpg`}/>
            </div>
          ))}
        </Slider>
      </div>
    );
  }
}
